import React, { Component } from 'react';

class Blogposts extends Component {
    render() {
        return(
            <div className="right-style">
                <ul>
                    <li><a href="https://www.imdb.com/" target="_blank">IMDB</a></li>
                    <li><a href="https://www.theinfatuation.com/" target="_blank">The Infatuation</a></li>
                    <li><a href="https://techcrunch.com/" target="_blank">TechCrunch</a></li>
                    <li><a href="https://originmaine.com/" target="_blank">Origin Maine</a></li>
                    <li><a href="https://www.nomadicmatt.com/" target="_blank">Nomadic Matt</a></li>
                </ul>
            </div>
        )
    }
}

export default Blogposts;
